import React from "react";
import BackButton from "./Buttons/BackButton";
import Zoom from "@material-ui/core/Zoom";
import UpButton from "./Buttons/UpButton";
import { MainDiv, StyledPaper, ItalicText, Text } from "./styles/ContentPages";
import { StyledCard, StyledCharliePic, CharlieDiv} from "./styles/Charlie"

import styled from "styled-components";
import Paper from "@material-ui/core/Paper";

const GreenHyperlink = styled.a`
  color: #6e7c5e;
`;

const GreenPaper = styled(Paper)`
width: 80%;
margin-top: 1em;
  background-color: #6e7c5e;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin-bottom: 1em;
`;



const TextDiv = styled.div`
display: flex;
flex-direction: column;
  justify-content: center;
  align-items: center;

`



export default function Bio(props) {
  return (
    <MainDiv>
      <BackButton onClick={() => props.transition("MENU")} />
      <Zoom in={true}>
        <StyledPaper>
          <GreenPaper>
            <TextDiv>
              <Text>talk about project here, links below</Text>
            </TextDiv>
            <StyledCharliePic alt="charlie" src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583447551/746D92A2-831D-46A8-A194-99EAE40BF631_gn9snn.jpg" />
          </GreenPaper>
          <ItalicText>
            The git repository for the site can be found{" "}
            <GreenHyperlink
              href="https://github.com/janeszelag/resumesite"
              target="_blank"
              rel="noopener noreferrer"
            >
              here.
            </GreenHyperlink>
          </ItalicText>
          <UpButton onClick={() => props.scrollUp()} />
        </StyledPaper>
      </Zoom>
    </MainDiv>
  );
}
